import React from "react";
import { Box, Paper, Stack, Link } from "@mui/material";
import AssignmentIcon from "@mui/icons-material/Assignment";
import LinkedInIcon from "@mui/icons-material/LinkedIn";
import GitHubIcon from "@mui/icons-material/GitHub";
import "../style/Icons.css";

function Icons() {
  return (
    <Box className="icons">
      <Stack direction="row" spacing={2} justifyContent="center">
        <Paper>
          <Link
            href="../data/Resume-Noel-Gon.pdf"
            style={{ backgroundColor: "#365946", textDecoration: "none" }}
          >
            <AssignmentIcon
              color="primary"
              style={{ backgroundColor: "#365946" }}
            />
          </Link>
        </Paper>
        <Paper>
          <a
            href="https://www.linkedin.com/in/noel-gonzalez-94408316b"
            type="button"
          >
            <LinkedInIcon />
          </a>
        </Paper>
        <Paper>
          <a type="button" href="https://github.com/Ng07886">
            <GitHubIcon />
          </a>
        </Paper>
      </Stack>
    </Box>
  );
}

export default Icons;
